#include<bits/stdc++.h>
using namespace std;
int c,t,l,ans;
string aa,cc,bb,s;
bool judge(string x,string y)
{
	int xx['z'+1]={0},yy['z'+1]={0},xxx=0,yyy=0;
	for (int ii=0;ii<x.length();++ii) xx[x[ii]]++;
	for (int ii=0;ii<y.length();++ii) yy[y[ii]]++;
	for (char ii='a';ii<='z';++ii)
		{
			if (xx[ii]%2==1) xxx++;
			if (yy[ii]%2==1) yyy++;
		}
	//cout<<xxx<<" "<<yyy<<endl;
	if (xxx<=yyy) return true;
	return false;
}
